import React, { Component } from 'react';
import ReactBootstrap, {Container, Row, Col, FormGroup} from 'react-bootstrap'; 


class SuggestionBox extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			suggested_items: []
		}
	}
	render() {
	    return (
			<div className='suggest-box-wrapper'>
				<ul>
					{this.state.suggested_items}
				</ul>
			</div>
	    )
	}

	componentWillReceiveProps() {		
		// console.log(this.props);
	}

	componentDidUpdate(prevProps, snapshot) {	
		console.log(snapshot);
		console.log('*' + this.props.suggestions);

		if (snapshot.suggestions != this.props.suggestions) {
			this.state.suggested_items.push(<li>{snapshot.suggestions}</li>);
		}


	}

	componentDidMount() {
	}
}

export default SuggestionBox;
